				<p class="t1">矢量图在设计中是必不可少的，放大或缩小不会产生锯齿，边缘平滑，是做UI的好伙伴</p>
				<p class="t2">制作矢量图的方法很多，在网页制作里面，尽可能使用SVG或CANVAS，用代码时间，能更好的做交互，而且体积也小，对网页优化很有帮助，制作 UI，一般都是使用Illustrator / After Effects。</p>
				<p class="t3"></p>
