			<span slot="bigt">Illustrator-可以直接制作svg并导出代码</span>
			<span slot="ITT_t1">使用AI制作svg是很方便的一件事，但是生成的代码有点杂乱，如果做精细的动画还是自己亲手写出来的好。</span>
			<span slot="ITT_t2">这幅原图来自网络，自己通过AI补全，把每个人物独立出来，可以制作动画，但是没人精确到每个动作上面，因为生成的代码是一整块polygon或者path</span>
			<span slot="ITT_t3">所以快速出效果的时候使用ai生成的代码也是能用的。</span>
